import React from 'react';
import { Link } from 'react-router-dom';

function Courses() {
  // Static course data
  const courses = [
    {
      id: 1,
      name: 'Data Science 101',
      description: 'Introduction to Data Science',
    },
    {
      id: 2,
      name: 'Machine Learning Fundamentals',
      description: 'Basic principles of machine learning',
    },
    {
      id: 3,
      name: 'Advanced Data Analysis',
      description: 'Advanced techniques in data analysis',
    },
  ];

  return (
    <div>
      <header>
        <h1>MS in DS Academic Program</h1>
      </header>
      <nav>
        <Link to="/files">Files</Link>
        <Link to="/grades">Grades</Link>
        <Link to="/appointments">Appointments</Link>
        <Link to="/messages">Messages</Link>
        <Link to="/index">Logout</Link>
      </nav>
      <div className="container">
        <h2>Courses</h2>
        <div className="course-tiles">
          {courses.map((course) => (
            <div key={course.id} className="course-tile">
              <h3>{course.name}</h3>
              <p>{course.description}</p>
              <Link to={`/syllabus/${course.id}`}>Course Syllabus</Link>
              <Link to={`/notes/${course.id}`}>Lecture Notes</Link>
              <Link to={`/assignments/${course.id}`}>Assignments</Link>
              <Link to={`/readings/${course.id}`}>Reading Materials</Link>
            </div>
          ))}
        </div>
      </div>
      <footer>
        <p>&copy; Copyright MS in DS Academic Program</p>
      </footer>
    </div>
  );
}

export default Courses;
